class vertice {
    constructor(x, y, name, color) {
        // let i=0
        push()
        this.x = x
        this.y = y+4
        this.color = color
        this.name = name
        this.radious = 4
        this.around = 2
        this.showing = false
        let model='content/stl/'+name+'.stl'
        this.teapot = loadModel(model, true);
        print(model,' loaded')
    }

    draw() {
        
        if (this.showing) {
            this.around = 7
            // this.x = mouseX
            // this.y = mouseY
            push()
            // print('showing', this.name)
            fill('red')
            translate(-(plotSize)/2, -plotSize/2, 0);
            ellipse(this.x, this.y, this.radious * 2, this.radious * 2)
            pop()
            push()
            // scale(0.4); // Scaled to make model fit into canvas
            // rotateZ(- 0.001);
            rotateX(-0.7);
            translate(0, -plotSize/4, 200);
            rotateY(frameCount * 0.01);
            // orbitControl(10);
            // rotate());
            model(this.teapot);
            pop()
            

        }
        else {
            this.around = 2
            noFill()
            push()
            translate(-(plotSize)/2, -plotSize/2, 0);
            // fill(this.color[0], this.color[1], this.color[2])
            ellipse(this.x, this.y, this.radious, this.radious)
            pop()
        }

    }

    clicked(x, y) {
        let d = dist(x, y, this.x, this.y)
        if (d < this.around) {
            // push()
            this.showing = !this.showing
            push()
        }
    }
}

